    public int MostBooked (int n, int[][] meetings) {
        int longCount = 0;
        int meetingsCount = meetings.GetLength(0);
        Array.Sort(meetings, (a, b) => a[0].CompareTo(b[0]));

        List<long[]>[] rooms = new List<long[]>[n];
        for (int r = 0; r < n; r++) rooms[r] = new List<long[]>();
        int[] roomsCount = new int[n];

        string str = "";
        for (int m = 0; m < meetingsCount; m++) {
            int[] meeting = meetings[m];
            //Console.WriteLine($"Meeting: {meetings[m][0]}-{meetings[m][1]}");
            int length = meetings[m][1] - meetings[m][0];
            long min = long.MaxValue;
            int minR = 0;
            int minRM = 0;
            /// check All Rooms
            for (int rL = 0; rL < n; rL++) {
                //bool found = false;
                List<long[]> room = rooms[rL];
                int roomMCount = room.Count;
                if (room.Count == 0) {
                    /// empty Room
                    if (meeting[0] < min) {
                        min = meeting[0];
                        minR = rL;
                        minRM = -1;
                    }
                    break;
                }

                /// check space between Meetings in Room
                for (int rM = 0; rM < roomMCount-1; rM++) {
                    if (room[rM+1][0] - room[rM][1] < length) break;
                }

                long minCliped = Math.Max(meeting[0], room[roomMCount-1][1]);
                if (minCliped < min) {
                    min = minCliped;
                    minR = rL;
                    minRM = roomMCount-1;
                }
            }

            roomsCount[minR]++;
            long start = Math.Max(meeting[0], min);
            long end = start + length;
            //Console.WriteLine($"Min: ({minR}/{minRM}) {meeting[0]}-{meeting[1]} -> {start}-{end}");
            List<long[]> roomMinR = rooms[minR];
            if (0 <= minRM) {
                bool left = minRM < roomMinR.Count && roomMinR[minRM][1] == start;
                bool right = minRM+1 < roomMinR.Count && end == roomMinR[minRM+1][0];
                if (left && right) {
                    roomMinR[minRM][1] = roomMinR[minRM+1][1];
                    roomMinR.RemoveAt(minRM+1);
                } else {
                    if (left) {
                        roomMinR[minRM][1] = end;
                    } else if (right) {
                        roomMinR[minRM+1][0] = start;
                    } else {
                        addNew();
                    }
                }
            } else {
                addNew();
            }

            void addNew () {
                //meetings[m][0] = start;
                //meetings[m][1] = end;
                longCount++;
                roomMinR.Add(new long[] { start, end });
            }

            //Console.WriteLine("Rooms:");
            //for (int r = 0; r < n; r++) {
            //    string s = $"({roomsCount[r]}): ";
            //    for (int mm = 0; mm < rooms[r].Count; mm++)
            //        s += $" {rooms[r][mm][0]}-{rooms[r][mm][1]}";
            //    Console.WriteLine(s);
            //}
            //Console.WriteLine();
        }

        Console.WriteLine();
        int maxR = 0;
        int max = roomsCount[0];
        Console.WriteLine(roomsCount[0]);
        for (int r = 1; r < n; r++) {
            Console.WriteLine(roomsCount[r]);
            if (max < roomsCount[r]) {
                maxR = r;
                max = roomsCount[r];
            }
        }
        Console.WriteLine($"longs {longCount}");
        return maxR;
    }

